INSERT INTO `helps` (`id`, `question`, `answer`, `role`) VALUES
(72, 'How to create a ticket?', 'Step 1: Click \"Ticket\" on the left side\n\nStep 2: Click \"CREATE TICKET\"\n\nStep 3: Fill out the form\n\nStep 4: Click \"Create Ticket\" in the bottom of the form.\n\nStep 5: Done.', '5'),
(79, 'How to attach multiple files?', 'PRESS Control Click or CTRL + CLICK', '5'),
(80, 'If staff will create ticket what\'s next?', 'Wait for your branch head to approve or you can approach if he or she is busy.', '5'),
(81, 'If the ticket was edited successfully, where can I check it?', 'You can check it in the reports.', '5'),
(82, 'If ticket was rejected?', 'In the meantime, please create a new ticket. Click the pen icon to check for notes and see if there are any instructions. (We will fix the edit button ASAP.)', '5'),
(83, 'Ticket rejection', 'Please add a note so that branch personnel can identify any issues. If not necessary, you can skip adding a note.', '2');
